import React, { useState } from "react";
import { FaBars } from "react-icons/fa";
import { FiSearch } from "react-icons/fi";
import { FaAngleRight } from "react-icons/fa";
import { VscChromeClose } from "react-icons/vsc";
function Home() {
  const dashboardData = [
    {
      img: "/images/leaf3.svg",
      title: "CREATE REVIEW",
    },
    {
      img: "/images/leaf2.svg",
      title: "EXPLORE PRODUCTS",
    },
    { img: "/images/leaf.svg", title: "JOURNAL" },
  ];

  const dashboardCard = dashboardData.map((card) => {
    return (
      <div key={card.title} className="w-full py-1 bg-[#E8E7D8]  rounded-md">
        <div className="xs:flex xss:grid xs:place-content-start xss:place-content-center gap-4 items-center ml-5 ">
          <img src={card.img} alt="" />
          <p className="text-3xl">{card.title}</p>
        </div>
      </div>
    );
  });

  const [openNav, setOpenNav] = useState(true);

  const handleNav = () => {
    setOpenNav(!openNav);
  };

  return (
    <section className="grid place-items-center">
      {/* 
      ///////////Profile////////
      ////////////////////////// */}
      <div className="max-w-[30rem] w-full pr-2 pl-3 relative">
        {openNav && (
          <div className="bg-[#3B2B2F] w-full -ml-3 h-[31%] z-10 absolute  ">
            <div>
              <div className="pt-7 pr-3">
                <VscChromeClose
                  onClick={handleNav}
                  className="text-white text-xl cursor-pointer ml-auto"
                />
              </div>

              {/* 
      ///////////Modal Nav////////
      ////////////////////////// */}

              <div className="flex justify-center hover:text-[#8DA249] cursor-pointer  flex-col items-center pb-3  ">
                {["JOURNAL", " SCAN", "  PROFILE", " YOUTUBE"].map((nav) => (
                  <p
                    key={Math.random()}
                    className="text-4xl text-white  hover:text-[#8DA249] cursor-pointer font-normal"
                  >
                    {nav}
                  </p>
                ))}
              </div>
            </div>
          </div>
        )}
        {/* Start */}
        <div className="mt-8">
          <div className="flex justify-end mt-5 mb-2 ">
            <FaBars
              className="text-xl w-[1.4rem] cursor-pointer"
              onClick={() => setOpenNav(true)}
            />
          </div>

          <div className="flex items-center justify-between">
            {/* Welcom section */}
            <div>
              <p className="font-family font-normal text-xl">Hello Rich ðŸ‘‹</p>
              <p className="font-family text-black/70 text-xs font-normal">
                Welcome back!
              </p>
            </div>
            {/* Search & Photo section */}
            <div className="flex gap-2 items-center justify-end">
              <div>
                <span className="w-6 h-6 rounded-md bg-[#E8E7D8] inline-block ">
                  <FiSearch className="mx-auto h-full text-base" />
                </span>
              </div>
              <div className="relative">
                <img
                  src="/images/L.svg"
                  className="w-6 h-6 absolute -left-1 bottom-0"
                />

                <img src="/images/EllipseLight.svg" className="w-12 h-12 " />
              </div>
            </div>
          </div>

          {/* 
      ///////////Dashboard////////
      ////////////////////////// */}

          <div className="mt-2">
            <p className="text-3xl">DASHBOARD</p>
            <div className="flex flex-col gap-5">{dashboardCard}</div>
          </div>

          {/* 
      ///////////watch high'er education section////////
      ////////////////////////// */}

          <div>
            <p className="text-2xl mt-4 font-normal text-[#3B2B2F]">
              Watch Highâ€™er Education
            </p>
            <div className="w-full py-2 bg-[#E8E7D8] rounded-md flex flex-col justify-center pl-2 mt-3">
              <div className="flex gap-3">
                <img src="/images/doctorLight.svg" alt="" />
                <div>
                  <p className=" text-sm text-[#3B2B2F] font-normal font-family">
                    THE TRIM ROOM
                  </p>
                  <p className="text-lg font-normal text-[#3B2B2F]">
                    FROM LEAFY TO LOVELY
                  </p>
                  <p className="text-black/60 text-sm font-family font-medium">
                    420 views, 5 Minutes
                  </p>
                </div>
              </div>
            </div>
          </div>

          {/* 
      ///////////recently reviewd section////////
      ////////////////////////// */}

          <div className="mt-3">
            <div className="flex justify-between items-center">
              <p className="text-[#3B2B2F] text-2xl font-normal">
                Recently Reviewed
              </p>
              <div className="flex items-center gap-3">
                <p className="text-sm  font-family">More Details</p>
                <FaAngleRight className=" text-[#111111]" />
              </div>
            </div>
          </div>

          {/* Cards */}

          <div className="mt-2 mb-3">
            <div className="flex flex-col gap-5">{dashboardCard}</div>
          </div>
        </div>
        {/* End */}
      </div>
    </section>
  );
}

export default Home;
